import React from 'react';

const ProgressTracker = ({ currentStep }) => {
  const steps = [
    { name: 'Primary Contact', description: 'Contact information for primary person' },
    { name: 'Lead Notifications', description: 'Contact for new patient lead notifications' },
    { name: 'Business Information', description: 'Details about your business and locations' },
    { name: 'Domain & Google My Business', description: 'Domain and Google account information' },
    { name: 'Logo', description: 'Upload your practice logo' },
    { name: 'Review & Submit', description: 'Review and submit your information' },
  ];

  return (
    <nav className="space-y-1">
      {steps.map((step, index) => (
        <a
          key={step.name}
          href="#"
          className={`group flex items-center px-3 py-2 text-sm font-medium rounded-md ${
            currentStep === index + 1
              ? 'bg-gray-100 text-gray-900'
              : 'text-gray-600 hover:bg-gray-50 hover:text-gray-900'
          }`}
        >
          <span className="truncate">{step.name}</span>
        </a>
      ))}
    </nav>
  );
};

export default ProgressTracker;
